def transform(sequence):
    first = sequence.find('7')
    sequence = sequence.replace('7', '6', 1)
    if first != -1:
        sequence = sequence[:first+1] + sequence[first+1:].replace('6', '7', 1)
    first = sequence.find('8')
    sequence = sequence.replace('8', '1', 1)
    if first != -1:
        sequence = sequence[:first+1] + sequence[first+1:].replace('1', '8', 1)
    return sequence
